import { extractId } from './extract-id';
describe('extract-id', function () {
  test('name with spaces', function () {
    expect(extractId({
      name: 'Name with spaces'
    })).toBe('NameWithSpaces');
  });
  test('duplicates id', function () {
    expect(extractId({
      name: 'Button'
    }, ['Button'])).toBe('Button77471352');
  });
});